import React from "react";
import styles from './MainSection.module.scss';

export function MainSection({userData})  {

  const students = userData.filter((user) => user.role === 'student')
  const driver = userData.filter((user) => user.role === 'driver')

  const printStudents = (student) => {
    return(
      <div>
        <span>Student : </span>{student.name}
        <div>{student.role}</div>
      </div>
    )
  }

  const printDriver = (user) => {
    return (
      <div>
        <span>Driver : </span>{user.name}
        <div>{user.role}</div>
      </div>
    )
  }

  return(
    <div>
      {
        students.map((student) => {
          printStudents(student)
        })
      }
    </div>
  )
}
